import React from 'react';
interface PropsType {
    id:number
}

export const FolderInfoToShow = () =>{
    return (
        <FolderInfo id/>
    )
}

const FolderInfo:React.FC<PropsType> = (props) => {
    return (
        <div>
            {props.id}
        </div>
    );
};

export default FolderInfo;
